import "./adminproduct.css"
import { useEffect, useState } from "react";
import axios from "axios"
function Adminproduct() {
    const [data, setdata] = useState([])
    useEffect(() => {
        async function fetch() {
            await axios.post("http://localhost:4500/food")
                .then(resp => {

                    console.log(resp.data, "axios")
                    setdata(resp.data)


                }).catch(
                    error => console.log(error)
                )
        }

        fetch()
    }, [])
    return (
        <>
            <div className="c">
                <div className="procon">
                    {data && data.map((e) => (
                        <div className="datacon">

                            <div className="pcon">
                                <div style={{position: "relative"}}>
                                    <img className="img" src={`./${e.image}`} ></img>
                                    <div style={{position: "absolute",bottom: 0,height:"100%",width: "100%", backgroundImage: "linear-gradient(rgba(0,0,0,0.01),#444)",display: "flex",alignItems:"end",justifyContent:"start"}}>
                                        <p className="pdesc">This is product description..</p>
                                        <p>%20 OFF</p>
                                    </div>
                                </div>

                                <div className="pricecon">
                                    <div style={{display:"flex",justifyContent:"space-between"}}>
                                        <p className="pname">{e.pname}</p>
                                        <p className="pprice">${e.price}</p>
                                    </div>

                                </div>

                            </div>
                        </div>
                    ))

                    }

                </div>
            </div>
        </>
    )
}
export default Adminproduct;
